import styled from 'styled-components';

export const LoginWrapper = styled.div`
    width:1351px;
    height:70px;
    background:#000;
`;
export const Header = styled.div`
    width:1200px;
    height:70px;
    margin:0 auto;
    background:yellow;
`;
export const Nav = styled.div`
    width:1200px;
    height:720px;
    margin:0 auto;
    margin-top:-70px;
    z-index:-2;
    background:url(data:image/jpeg;base64,);
    position:relative;    
        .login{
            width:380px;
            height:492px;
            border:1px solid red;
            background:#fff;
            position:absolute;
            right:74px;
            top:220px;
            padding:30px;
            div{
                float:left;
                width:190px;
                height:20px;
                font-size:18px;
               text-align:center;
               margin-bottom:50px;
            }
        }
`;
export const Input = styled.input`
    display:block;
    width:300px;
    height:20px;
    line-height:50px;
    margin:0 auto;
    margin-top:15px;
    border:1px solid #dedede;
    padding:14px 5px;
`;
export const Button = styled.button`
    display:block;
    width:315px;
    height:50px;
    margin:0 auto;
    margin-top:50px;
    font-size:160x;
    color:#fff;
    font-weight:bold;
    background-color:#f19108;
    border:none;
`;
